import React from 'react';
import './App.css';
import NaviBar from './components/NaviBar';



function App() {
  return (



    <div className="App">

      <NaviBar />

      <header className="App-header">

        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>

      </header>
    </div>
  );
}

export default App;
